import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import LoginForm from './LoginForm';
import OtherComponent from './OtherComponent'; // Replace with actual component imports
import './App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <h1>Aplikacija za lov</h1>
        <div className="button-container">
          <Link to="/login"><button className="app-button">Login</button></Link>
          <Link to="/other-route"><button className="app-button">Other Route</button></Link>
        </div>
        <Routes>
          <Route path="/login" element={<LoginForm />} />
          <Route path="/other-route" element={<OtherComponent />} />
          {/* More routes here */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
